require 'cftemplate'

# Max 32 parameters

template '2010-09-09' do
  parameter 'StringParam', 'String'
  parameter 'NumberParam', 'Number'
  parameter 'ListParam', 'CommaDelimitedList'

  parameter 'DescriptionParam', 'String', 'P'
  parameter 'LongDescription', 'String', ''

  parameter 'ConstraintDescription1', 'String',
            :constraint => 'A'
  parameter 'ConstraintDescription2', 'String',
            'ConstraintDescription' => 'A'

  parameter 'LongConstraintDescription1', 'String', 'param description',
            :constraint => ''
  parameter 'LongConstraintDescription2', 'String', 'param description',
            'ConstraintDescription' => ''

  parameter 'Pattern1', 'String',
            :pattern => '\d+'
  parameter 'Pattern2', 'String',
            'AllowedPattern' => '\d+'


  # At least one resource is required
  resource 'Dummy', 'AWS::CloudFormation::WaitConditionHandle'
end
